script: |
  super -f text -I q6450.spq | sort > q6450.out

inputs:
  - name: q6450.spq
    data: |
      SELECT DISTINCT + + col0 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN col1 * - 36 * col0 * + ( + 90 ) / + col1 + + 35 + CAST ( - col0 AS INTEGER ) / + + col0 AND NULL;
  - name: tab2

outputs:
  - name: q6450.out
    data: |
